『マジカルアートシート』は、高耐候塩ビシートの表面にカーボン柄の凹凸をつけで見た目、手触り等をリアルカーボンに近い仕上がりにしています。<br>カーボンアイテム中最薄商品となり厚さ0.2mm以下なので施工部分の段差が少なく、仕上がりの違和感もあまり感じません。<br><br>ドライヤー等で熱することによりかなりの伸縮性を発揮します。<br><br>車種専用カットタイプなので、各パーツの形状に合わせて加工されており、そのまま貼り付けるだけでOKです。<br><br><br>★リアドアノブ専用のマジカルアートシートです。<br><br><br>【仕様】<br><br>■材質 ： マジカルアートシート<br>■適合車種 ： C-HR ZYX10/NGX50系 H28.12～<br>■商品内容 ： マジカルアートシート リアドアノブ<br>■カラー ： ブラック<br>■品番 ： MS-DT37<br>■メーカー ： HASEPRO / ハセプロ<br><br><br>※ご注文確定後にメーカーへオーダーする商品です。<br>※車種専用のマジカルアートシートのみの販売となります。<style type="text/css">
